import React, { Component } from "react";
import cardData from "./matchcards.json";

class App extends Component {
  state = {
    message: "Welcome to my app!",
    cards: [],
  };
  componentDidMount() {
    this.setState({
      cards: [...cardData],
    });
  }

  render() {
    var one = "dog";
    var two = one;
    two = "cat";
    console.log(one, two);

    var arr1 = ["a"];
    var arr2 = arr1;
    arr2.push("b");
    arr2.push("c");
    console.log(arr1, arr2);

    var arr3 = ["A"];
    var arr4 = [].concat(arr3);
    arr4.push("B");
    console.log(arr3, arr4);

    var arr5 = ['0'];
    var arr6 = [...arr5];
    arr6.push('1');
    console.log(arr5, arr6);

    return (
      <div className="App">
        <h1>{this.state.message}</h1>
      </div>
    );
  }
}

export default App;
